import React from "react";
import "./notices.css";
import Header from "../../components/header/header.js";
import Footer from "../../components/footer/footer.js";

const Menu = () => {
    const newsLinks = [
        {
            title: "",
            url: "noticias/noticia1",
        },
        {
            title: "Noticia 2",
            url: "noticias/noticia1",
        },
        {
            title: "Noticia 3",
            url: "noticias/noticia1",
        },
    ];

    return (
        <>
            <div><Header /></div>
            <div >
                <h2 className="menu">Men√∫ de Noticias</h2>
                <h2 class="menu"><img src="https://cdn.icon-icons.com/icons2/112/PNG/512/rss_18953.png" width={40}/></h2>
                <ul>
                    {newsLinks.map((link, index) => (
                        <li class="notice" key={index}>
                            <a href={link.url} target="_blank" rel="noopener noreferrer">
                                {link.title}
                            </a>
                        </li>
                    ))}
                </ul>
            </div>
            <div><Footer/></div>
        </>
    );
};

export default Menu;
